import React from 'react';

const Ho = () => {
  // URL de ejemplo de una imagen en Google Cloud Storage
  const imageUrl = "https://storage.googleapis.com/tu-bucket/imagen.jpg";

  return (
    <div>
      <h1>Imagen desde Google Cloud Storage</h1>
      <img src={imageUrl} alt="Imagen desde Google Cloud Storage" />
    </div>
  );
};

export default Ho;
